import React from 'react';
import { Link } from 'react-router-dom';
import './Header.scss';
/*icons*/
import user from '../assets/img/icons/user.svg'
import facebook from '../assets/img/social/facebook.svg'
import youtube from '../assets/img/social/youtube.svg'
import instagram from '../assets/img/social/instagram.svg'
import logo from '../assets/img/icons/main-logo.svg'

export const Header = () => {
    return (
      <header className='header-menu-wrap'>
        <div className="header-logo">
        <img src={logo}
                        className="header-logo__icon"
                        alt=""
                    />
                <Link to="#" className="header-logo__link"
                    ><h2 className="header-title">OFF THE HOOK</h2></Link>
                
            </div>
            <nav className="nav-menu">
                
                <Link to="/" className="nav-menu__link nav-menu__link-active" onClick={this.handleClick}>Home</Link>
                <Link to="/blog" className="nav-menu__link">Blog</Link>
                <Link to="/contact" className="nav-menu__link">Contact</Link>
            </nav>
            <div className="icons-wrap">
                <button className="login-btn">
                    <img src={user}
                        className="icon-item__link-img login-btn__icon"
                        alt=""
                    />
                    <span className="btn-title">Log In</span>
                </button>
                <div className="social-icons-wrap">
                <Link to="#" className="icon-item__link"
                    ><img
                        src={facebook}
                        className="icon-item__link-img"
                        alt="facebook"
                    /></Link>
                <Link to="#" className="icon-item__link"
                    ><img
                        src={youtube}
                        className="icon-item__link-img"
                        alt="youtube"
                /></Link>
                <Link to="#" className="icon-item__link"
                    ><img
                        src={instagram}
                        className="icon-item__link-img"
                        alt="instagram"
                        /></Link>
              </div>              
                
            </div>
      </header>
    );
};
